import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Sub from "./Sub";
import notes from "./notes";
var React=require("react");
function App(){
    return (<div>
        <Header></Header>
        <Note ></Note>
         <Sub ti={Note.title}
         con={Note.content} />
        <Footer></Footer> 
    </div>);
}
export default App;
